} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";

function Footer() {
  let date = new Date();
  let year = date.getFullYear();
  return (
    <Container fluid className="home-about-section" style={{ backgroundColor: '#313131'}}>
      <Container>
        <Row>
          <Col md={12} className="home-about-description">
            <h1 style={{ fontSize: '2.6em', color: '#fff' }}>Our{' '}<span className="services-bold">Features</span></h1>
            <p  style={{ color: '#fff' }}>Letter of on become he tended active enable to. Vicinity relation sensible sociable surprise screened no up as.</p>
          </Col>
        </Row>
      </Container>
    </Container>
  );
}

export default Footer;
